{"1": ["Отлично, быстрая доставка", "2021-05-08T12:33:30Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "4": ["Дороговато, нашел дешевле .А смазка хорошая.", "2021-04-29T10:05:19Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "11": ["не особо люблю вайберис, ну решил заказать и очередной раз разочаровался.... полу пустой пришел.... увы больше не буду заказывать....", "2021-04-08T22:35:52Z", "", "0", 1, 1, 1, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "13": ["Цена кусачая, но подкупает широким спектром применения в быту", "2021-04-08T12:40:05Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "22": ["Раньше покупал в оффлайне, теперь заказал здесь. Очень хорошая смазка, пользуюсь несколько лет, в основном для  сантехники. Из главных плюсов - не высыхает и плохо вымывается. Ценник, конечно, кусачий, но  можно себе позволить.", "2021-03-19T19:30:12Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "27": ["Смазка пришла в целой запечатанной индивидуальной упаковке, свежая изготовлена декабрь 2020 года. Цена адекватная но можно и по дешевле ( это уже к производителю). Хорошая сфера применения. Качество и долговечность покажет время.", "2021-03-12T15:34:37Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "34": ["Смазывала колёса у сумки тележки, отлично больше не скрипят. Удобный носик у тюбика. Нужная вещь в доме, я довольна.  ", "2021-02-19T12:20:44Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "35": ["Многофункциональная. Качественная", "2021-02-18T13:07:35Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "38": ["Смазал им уплотнитель дверцы холодильника, как рекомендуют в официальном сайте, потом еле открыл дверь, у этого силикона эффект клея, в хозяйстве пригодится", "2021-02-01T10:49:15Z", "", "0", 2, 1, 4, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "39": ["Вещь очень старая и все что изменилось с ней за многие года, это повышение цены.", "2021-01-27T15:40:45Z", "", "0", 1, 2, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "40": ["Товар пришёл просроченный,к сожалению увидели это только дома", "2021-01-18T13:21:06Z", "", "0", 4, 3, 1, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "41": ["Брали для кофемашины. Смазали работает лучше и тиши. И не дорого", "2021-01-18T13:18:51Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "42": ["Процентов 20 смазки в тюбик не доложили. На фото видно, как пришлось сжать тюбик чтобы смазка появилась из тюбика.", "2021-01-03T16:00:58Z", "", "0", 4, 1, 2, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "44": ["Думаю не должен стоить таких денег продукт отечественного производителя.", "2021-01-03T11:07:52Z", "", "0", 6, 2, 3, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "45": ["Мне понравилось", "2021-01-02T07:05:34Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "46": ["Удобный в работе.", "2020-12-28T20:46:34Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "47": ["Отлично. Удобная упаковка, свои функции выполняет на 100%. ", "2020-12-28T06:55:59Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "48": ["Отличная смазка!", "2020-12-22T15:48:42Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "49": ["Хорошая смазка, впервые купили ее тут благодаря объему и цене.", "2020-12-19T05:10:55Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "50": ["Хорошая универсальная смазка", "2020-12-16T10:56:27Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "51": ["Всё  пришло  хорошо  упаковано  и без повреждений", "2020-12-14T11:18:30Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "52": ["Нормальная смазка единственное под крышкой на тюбеке нет пломбы не понятно сливал и от туда смазку или нет не взвешивал", "2020-12-13T10:19:49Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "53": ["Класс на машине резинки на дверях промазал не примерзают.", "2020-12-12T12:33:32Z", "", "0", 2, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "58": ["Отличная смазка, не слишком густая и не слишком жидкая. Смазываю резиновые прокладки во внешних аквариумных фильтрах.", "2020-12-03T07:52:23Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "60": ["консистенция хорошая, тюбик не большой, но и не кроха... скажем так, смазал поворотный механизм - теперь не могу зафиксировать )))", "2020-11-23T17:48:03Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "64": ["Пока не проверял но упаковка целая без повреждения.", "2020-11-19T12:13:13Z", "", "0", 0, 2, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "70": ["Товар пришел в отличном состоянии.", "2020-11-15T09:55:52Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "71": ["Отличная силиконовая смазка! В меру густая, отлично держится. Очень удобный тонкий носик у тюбика. Из проблем, которые я успел устранить - скрип подшипников детской кроватки, скрип прогулочной коляски Valco baby snap 4 в месте, которое раскладывается и складывается. Скрип коляски особенно раздражал и ничего не спасало. И WD40 брызгал и техническим маслом смазывал, но помогла лишь эта смазка. В общем очень полезная в хозяйстве штука! Настоятельно рекомендую к приобретению. ", "2020-11-14T11:23:56Z", "", "0", 3, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "74": ["Пока что нигде не применял. Действительно прозрачный и без запаха. Густой хороший силикон.", "2020-11-13T06:58:15Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "78": ["Неплохой силикон.", "2020-11-01T18:38:15Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "80": ["хороший силикон густой", "2020-11-01T16:24:45Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "81": ["Это не смазка, это спасение. Установили межкомнатные двери купе (раздвижные), они гремели просто ужас, после смазки произошло нереальное чудо, ни шума, ни скрипа. Спасибо Вам!", "2020-10-27T13:23:22Z", "", "0", 2, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "82": ["Заказ был упакован в запаянную пупырку, всё целое, не помятое. Смазка отличная. Брал для бытовых нужд.", "2020-10-24T00:48:19Z", "", "0", 3, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "83": ["Для сантехники и пневматики пластиковых деталей, самое то.", "2020-10-22T19:42:12Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "84": ["Удобная упаковка. Отличный силикон. Действительно 1000 применений. Рекомендую.", "2020-10-21T11:17:35Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "85": ["Давно таким пользуюсь, для сушилки овощей, хлебопечки, фена, и.т.д.", "2020-10-14T11:39:23Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "86": ["Расход небольшой, использовала для колёс коляски. ", "2020-10-11T17:42:11Z", "", "0", 1, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "88": ["Товаром доволен смазывал кулису мпп на киа рио, можно и резинки смазать.", "2020-10-01T16:25:38Z", "", "0", 3, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "89": ["лучшая смазка", "2020-09-21T13:29:28Z", "", "0", 1, 0, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "90": ["Надеюсь хороший!", "2020-09-15T08:44:26Z", "", "0", 0, 1, 5, "Смазка универсальная силиконовая SILICOT 30 г", "ВМПАВТО"], "92": ["В автомагазинах такая есть у нас 215 р", "2020-08-03T10:45:02.233254927Z", "colorless", "0", 4, 0, 5, "Смазка универсальная силиконовая SILICOT (30 г)", "ВМПАВТО"], "93": ["Смазал пластины в картридже (grohe) для смесителя, картридж как новый!", "2020-07-30T11:36:16.213226008Z", "colorless", "0", 3, 1, 5, "Смазка унив. силиконовая SILICOT (30 г)", "ВМПАВТО"], "94": ["Тюбик с воздухом внутри. Продаем воздух?!", "2020-07-29T05:11:39.593777216Z", "colorless", "0", 5, 3, 3, "Смазка унив. силиконовая SILICOT (30 г)", "ВМПАВТО"], "95": ["Упаковка отличная, в работе ещё не использовал.", "2020-07-27T13:05:01.015666851Z", "colorless", "0", 1, 14, 5, "Смазка унив. силиконовая SILICOT (30 г)", "ВМПАВТО"], "96": ["Упаковано хорошо ! Но почему то тюбик на треть пустой . Может так и должно быть по весу или кто то применил не по назначению. Смазал излив кухонного смесителя. Если не вымывается водой (как обещает производитель) , то рекомендую! Консистенция смазки отличная.", "2020-06-28T06:14:12.430564837Z", "colorless", "0", 7, 0, 5, "Смазка унив. силиконовая SILICOT (30 г)", "ВМПАВТО"], "97": ["Упаковано хорошо,тюбик имеет тонкий носик-удобно наносить.Брала для смазывания некоторых узлов в швейной машине.Произведено 05.2020( свежачок).", "2020-06-15T11:55:04.89406417Z", "colorless", "0", 6, 0, 5, "Смазка унив. силиконовая SILICOT (30 г)", "ВМПАВТО"]}
